.label-wrapper{
	 .list{
		 display flex
		 flex-wrap wrap
		 .label-item{
			 margin 10px 8px 10px 0
			 padding: 3px 14px;
			 background #EEEEEE
			 color #333333
			 border-radius 2px
			 cursor pointer
			 font-size 12px
			 border 1px solid #EEEEEE
			 &.on{
				 color #1890FF
				 border-color #1890FF
				 background-color #fff;
			 }
		 }
	 }
	 .footer{
		 display flex
		 justify-content flex-end
		 margin-top 40px
		 button{
			  margin-left 10px
		 }
	 }
}
.btn{
	width 60px
	height 24px
}	
.title{
	font-size 13px
}
.list-box{
	overflow-y auto
	overflow-x hidden
	max-height 240px
}
